Let's call the source mysqld instance donor . We use the clone plugin to copy the whole data quickly. After the cloning, MOCO needs to create some user accounts and install plugins. On the donor , you need to install the plugin and create two user accounts as follows: mysql> INSTALL PLUGIN clone SONAME mysql_clone.so;
mysql> CREATE USER 'clone-donor'@'%' IDENTIFIED BY 'xxxxxxxxxxx';
mysql> GRANT BACKUP_ADMIN, REPLICATION SLAVE ON *.* TO 'clone-donor'@'%';
mysql> CREATE USER 'clone-init'@'localhost' IDENTIFIED BY 'yyyyyyyyyyy';
mysql> GRANT ALL ON *.* TO 'clone-init'@'localhost' WITH GRANT OPTION;
mysql> GRANT PROXY ON ''@'' TO 'clone-init'@'localhost' WITH GRANT OPTION; You may change the user names and should change their passwords. Then create a Secret in the same namespace as MySQLCluster: $ kubectl -n <namespace> create secret generic donor-secret \ --from-literal=HOST=<donor-host> \ --from-literal=PORT=<donor-port> \ --from-literal=USER=clone-donor \ --from-literal=PASSWORD=xxxxxxxxxxx \ --from-literal=INIT_USER=clone-init \ --from-literal=INIT_PASSWORD=yyyyyyyyyyy You may change the secret name. Finally, create MySQLCluster with spec.replicationSourceSecretName set to the Secret name as follows. The mysql image must be the same version as the donor's. apiVersion: moco.cybozu.com/v1beta2
kind: MySQLCluster
metadata: namespace: foo name: test
spec: replicationSourceSecretName: donor-secret podTemplate: spec: containers: - name: mysqld image: quay.io/cybozu/mysql:8.0.28 # must be the same version as the donor volumeClaimTemplates: - metadata: name: mysql-data spec: accessModes: [ "ReadWriteOnce" ] resources: requests: storage: 1Gi To stop the replication from the donor, update MySQLCluster with spec.replicationSourceSecretName: null.
